import React from 'react';

const StudentDashboard = () => {
  return (
    <div className="p-4">
      <h2>Welcome to the Student Dashboard</h2>
      <p>Here you can view your bookings, courses, and receive notifications.</p>
    </div>
  );
};

export default StudentDashboard;
